import * as React from "react";
import Button from "@mui/material/Button";
import TextField from "@mui/material/TextField";
import Dialog from "@mui/material/Dialog";
import DialogActions from "@mui/material/DialogActions";
import DialogContent from "@mui/material/DialogContent";
import DialogContentText from "@mui/material/DialogContentText";
import DialogTitle from "@mui/material/DialogTitle";
import { useNavigate } from "react-router-dom";
import useAuth from "./hooks/useAuth";
import useLogout from "./hooks/useLogout";
import Radio from "@mui/material/Radio";
import RadioGroup from "@mui/material/RadioGroup";
import FormControlLabel from "@mui/material/FormControlLabel";
import FormControl from "@mui/material/FormControl";
import FormLabel from "@mui/material/FormLabel";
import { Box } from "@mui/system";

const PopUpForm = () => {
  const [open, setOpen] = React.useState(false);
  const logout = useLogout();
  const navigate = useNavigate();

  const signOut = async () => {
    await logout();
    navigate("/login");
  };
  const handleClose = () => {
    setOpen(false);
  };

  return (
    <div>
      <Dialog open={true} onClose={handleClose}>
        <DialogTitle>Informacje dodatkowe</DialogTitle>
        <DialogContent>
          <DialogContentText>
            Aby rozpocząć korzystanie z naszej platformy potrzebujemy kilku
            dodatkowych informacji o Tobie.
          </DialogContentText>
          <Box>
            <TextField
              autoFocus
              margin="dense"
              id="name"
              label="Imię"
              fullWidth
              variant="standard"
            />
            <TextField
              autoFocus
              margin="dense"
              id="name"
              label="Nazwisko"
              fullWidth
              variant="standard"
            />
          </Box>
          <TextField
            autoFocus
            margin="dense"
            id="name"
            label="Adres e-mail"
            type="email"
            fullWidth
            variant="standard"
          />
          <FormControl>
            <FormLabel>Rola</FormLabel>
            <RadioGroup defaultValue="Student" row>
              <FormControlLabel
                labelPlacement="end"
                value="student"
                control={<Radio />}
                label="Student"
              />
              <FormControlLabel
                value="teacher"
                control={<Radio />}
                label="Nauczyciel"
              />
            </RadioGroup>
          </FormControl>
        </DialogContent>
        <DialogActions>
          <Button onClick={signOut}>Wyloguj</Button>
          <Button onClick={handleClose}>Wyślij</Button>
        </DialogActions>
      </Dialog>
    </div>
  );
};

export default PopUpForm;
